We need to count how many positive whole-number divisors of $196=2^2\cdot7^2$ exist. The general form of a divisor of $p_1^{a_1}\cdots p_n^{a_n}$ is $p_1^{b_1}\cdots p_n^{b_n},$ where $0\leq b_i\leq a_i.$ Hence, the positive divisors of $196$ correspond to the ordered pairs $(b_1,b_2),$ where $0\leq b_1\leq 2$ and $0\leq b_2\leq 2$. Thus, the possible pairs are \begin{align*}
(0,0),(0,1),(0,2),(1,0),(1,1),(1,2),(2,0),(2,1),(2,2)
\end{align*}As there are $9$ pairs, there are $\boxed{9}$ positive whole-number divisors of $196$. The answer is: 9.
